import React from 'react';
import Form from './components/Form';
import { BrowserRouter as Router, Routes, Route } from 'react-router-dom'
import PaymentPage from './components/PaymentPage.js';

const App = () => {
  return (
    <div className="App">
      <h1>Health Insurance Premium Calculator</h1>
      <Router>
        <Routes>
          <Route path="/" element={<Form />} /> {/* Render Form component when on the root path */}
          <Route path="/paymentpage" element={<PaymentPage />} /> {/* Render PaymentPage component when on /paymentpage path */}
        </Routes>
      </Router>
    </div>
  );
};

export default App;
